import React, { useEffect, useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import axios from 'axios';
import './Dashboard.css';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip, ResponsiveContainer } from 'recharts';
import dashboardIcon from '../icon/dashboard.png'; // Perbaiki path relatif

function Dashboard() {
  const [fullName, setFullName] = useState('');
  const history = useHistory();

  useEffect(() => {
    const username = localStorage.getItem('username');
    const fetchUserData = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/user?username=${username}`);
        setFullName(response.data.full_name);
      } catch (error) {
        console.error('Failed to fetch user data:', error);
      }
    };
    fetchUserData();
  }, []);

  const logout = () => {
    localStorage.removeItem('username');
    history.push('/login');
  };

  const data = [
    { name: 'Jan', sales: 4000, orders: 2400 },
    { name: 'Feb', sales: 3000, orders: 1398 },
    { name: 'Mar', sales: 2000, orders: 9800 },
    { name: 'Apr', sales: 2780, orders: 3908 },
    { name: 'May', sales: 1890, orders: 4800 },
    { name: 'Jun', sales: 2390, orders: 3800 },
    { name: 'Jul', sales: 3490, orders: 4300 },
  ];

  return (
    <div className="dashboard-container">
      <nav className="sidebar">
        <div className="sidebar-user">
          <img src={dashboardIcon} alt="User Profile" className="profile-pic" /> {/* Use imported image */}
          <p>{fullName}</p>
        </div>
        <ul>
          <li><Link to="/dashboard"><i className="fas fa-tachometer-alt"></i> Dashboard</Link></li>
          <li><Link to="/products"><i className="fas fa-box"></i> Products</Link></li>
          <li><Link to="/transactions"><i className="fas fa-exchange-alt"></i> Transactions</Link></li>
          <li><Link to="/users"><i className="fas fa-users"></i> Users</Link></li>
          <li><a onClick={logout}><i className="fas fa-sign-out-alt"></i> Log Out</a></li>
        </ul>
      </nav>
      <main className="main-content">
        <header className="dashboard-header">
          <h1>Welcome, {fullName}</h1>
        </header>
        <div className="stats">
          <div className="stat-card">
            <h2>Total Sales</h2>
            <p className="text-green">$30,412</p>
            <p>↑ 1.5% vs last Month</p>
          </div>
          <div className="stat-card">
            <h2>Total Orders</h2>
            <p className="text-red">$12,980</p>
            <p>↓ 0.7% vs last Month</p>
          </div>
        </div>
        <div className="chart-container">
          <h2>Sales and Orders Over Time</h2>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={data}>
              <Line type="monotone" dataKey="sales" stroke="#8884d8" />
              <Line type="monotone" dataKey="orders" stroke="#82ca9d" />
              <CartesianGrid stroke="#ccc" />
              <XAxis dataKey="name" />
              <YAxis />
              <Tooltip />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </main>
    </div>
  );
}

export default Dashboard;
